message:
⚡️ Uma gravação supostamente mostra o helicóptero minutos antes do acidente

 O Ministério do Interior ucraniano está considerando três versões como as causas do acidente de helicóptero em Brovary:

 - sabotar;
 — mau funcionamento do equipamento;
 — Violação das normas de segurança.

 O ministro do Interior, Denis Monastyrskiy, seu primeiro vice-chefe, Evgeny Jenin, e o secretário de Estado do Interior, Yuri Lubkovich, estavam entre os mortos.
